import React from "react";
import Header from "./components/Header";
import Footer from "./components/Footer";
import Items from "./components/Items";

export default function App() {
    let items = [
        {
            id: 1,
            title: "Gray tent"
        },
        {
            id: 2,
            title: "Blue tent"
        },
        {
            id: 3,
            title: "Green tent"
        },
        {
            id: 4,
            title: "Red tent"
        },
    ];


    return (
        <div className="wrapper">
            <Header />
            <Items items={items} />
            <Footer />
        </div>
    );
}
